import hrimg from '../images/hrimg.webp'

import Module from './Module'
import { useState } from 'react'

function Main() {

    let [enter, setEnter] = useState(true)

    function handleenter() {
        setEnter(!enter)
    }

    return (
        <>
            <div>
                {
                    enter === true ?
                        <div className='main'>
                            <figure>
                                <img src={hrimg} alt="" />
                            </figure>
                            <div> </div>

                        </div> :
                        <div>
                            <Module enter={handleenter} />
                        </div>

                }
            </div>
        </>
    )
}

export default Main
